webpackJsonp([0xb9a6b19ab2e5],{5479:function(e,t){e.exports={data:{post:{html:"<p>All three crises are still bubbling.<br />\nThe number of informants in the <b>NPD scandal</b> is up to 5, maybe 6, and there are more and more calls from FDP and CDU to drop the case.<br />\nMeanwhile, in the <b>job placement scandal</b>, reports are that Arbeitsamt head Jagoda was informed of irregularites 4 years ago, and other reports that he ordered his investigators to refute the current charges, rather than to see if they were true.  He's not a political appointee, but he's probably on the way out.<br />\nAnd in Brussels, Schr√∂der may have avoided a formal <b>EU budget warning</b>, but at the cost of a lot of bad blood in the Commission and the smaller member countries.<br />\nI can't remember that Kohl ever had to juggle 3 crises at once. Hell, Kohl couldn't juggle at all.</p>",fields:{title:"Three Monkeys",date:"11 Feb 2002",url:"https://papascott.de/2002-02-11-three-monkeys/"}}},pathContext:{slug:"/2002-02-11-three-monkeys/",prev:{fields:{title:"Schill To Take Drug Test",date:"09 Feb 2002",slug:"/2002-02-09-schill-to-take-drug-test/"}},next:{fields:{title:"Tweedle Dum & Tweedle Dee",date:"11 Feb 2002",slug:"/2002-02-11-tweedle-dum-tweedle-dee/"}}}}}});
